import React from 'react';
import styles from './card.module.css'

const Card = () => {
    return (
        <div className={styles.card}>
            <div className={styles.infoTop}>
                <div className={styles.nameCar}>Subaru LEVORG VN5</div>
                <div className={styles.mileage}>2021 • Гибрит • 10 000 км</div>
            </div>
            <div className={styles.infoBottom}>
                <div className={styles.price}>2 115 600 ₽</div>
                <button className={styles.btn}></button>
            </div>
        </div>
    );
}

export default Card;
